import { Slider } from "@mui/material";
import React from "react";

const Monitor = ({ Error }) => {

    return <div> <Slider
        disabled={false}
        marks={false}
        step={0.1}
        max={10}
        min={1}
        size="small"
        valueLabelDisplay="on"
    /></div>
}

export default Monitor;
